import React from 'react'
import './content.css';
function Content() {
  return (
    <main className='Bg'>
      <div className='text'>
        <p>EpsilonAI., Ltd. is a visionary venture company dedicated to the concept of "Live with Characters." Their mission is to create a world where individuals can experience the joy of living alongside their favorite characters.</p>
      </div>
    </main>
  );
}

export default Content
